webpackJsonp([297],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-learn-about-ruby-hashes.json":function(e,a){e.exports={data:{markdownRemark:{html:"<h3>Basics:</h3>\n<ul>\n<li>Ruby hashes are comparable to Javascript objects or dictionaries in languages like Python.</li>\n<li>Hashes contain items that are stored by <code>key: value</code> pairs.</li>\n<li>\n<p>Ruby hashes can be created using the following methods:</p>\n<ul>\n<li><code>my_hash = {}</code></li>\n<li><code>my_hash = Hash.new</code></li>\n</ul>\n</li>\n<li>There are many methods built into Ruby to find information from and update hashes.</li>\n</ul>\n<h2>Examples:</h2>\n<pre><code>my_hash = {'name' => 'Batman', 'age' => 25}\n# is equivalent to:\nmy_hash = Hash.new\nmy_hash['name'] = 'Batman'\nmy_hash['age'] = 25\n# Both of these examples return:\n{\"name\"=>\"Batman\", \"age\"=>25}\n\n# here is an alternative way to create the array:\n{name: 'Batman', age: 25}\n# this example return:\n{:name=>\"Batman\", :age=>25}\n# learn more about [symbols here](http://www.randomhacks.net/2007/01/20/13-ways-of-looking-at-a-ruby-symbol/)\n</code></pre>\n<h2>References:</h2>\n<ul>\n<li><a href=\"http://ruby-doc.org/core-2.2.0/Hash.html\">The official Ruby documentation for hashes</a>.</li>\n</ul>",frontmatter:{title:"Learn About Ruby Hashes",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/learn-about-ruby-hashes/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/learn-about-ruby-hashes/"}}}});
